// IdeaList.js
import React from "react";
import { useAppContext } from "./AppContext";

const IdeaList = () => {
  const { state } = useAppContext();

  return (
    <div>
      <h2>Ideas</h2>
      <ul>
        {state.ideas.map((idea, index) => (
          <li key={index}>
            <strong>{idea.category}:</strong> {idea.text}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default IdeaList;
